package leetcode;

import java.util.PriorityQueue;
import java.util.Queue;

/**
 * @description: Given a string s, sort it in decreasing order based on the frequency of the characters. The frequency of a character is the number of times it appears in the string.
 * <p>
 * Return the sorted string. If there are multiple answers, return any of them.
 * @author: LISHUAI
 * @createDate: 2022/12/4 0:26
 * @version: 1.0
 */

public class LeetCode_451 {

    public static void main(String[] args) {
//        String s = "Aabb";
//        String s = "tree";
//        String s = "cccaaa";
//        String s = "2a554442f544asfasssffffasss";
        String s = "";
        String s1 = frequencySort(s);
        System.out.println(s1);
    }

    public static String frequencySort(String s) {
        int[] counts = new int[62];
        for (char c : s.toCharArray()) {
            if (c >= 'a') {
                counts[c - 'a' + 36]++;
            } else if (c >= 'A') {
                counts[c - 'A' + 10]++;
            } else {
                counts[c - '0']++;
            }
        }
        Queue<Integer> queue = new PriorityQueue<>((a, b) -> (counts[b] - counts[a]));
        for (int i = 0; i < counts.length; i++) {
            if (counts[i] > 0) {
                queue.offer(i);
            }
        }
        StringBuilder sbr = new StringBuilder(s.length());
        while (!queue.isEmpty()) {
            int q = queue.poll();
            char c;
            if (q >= 36) {
                c = (char) (q + 'a' - 36);
            } else if (q >= 10) {
                c = (char) (q + 'A' - 10);
            } else {
                c = (char) (q + '0');
            }
            sbr.append((c + "").repeat(counts[q]));
        }
        return sbr.toString();
    }
}
